package javaVariavel01;

public class OperadoresAritimeticos02 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int a = 5;
		int b = 4;
		
		System.out.println(a * b); // 20
		System.out.println(a + b); // 9
		System.out.println(a - b); // 1
		System.out.println(a / b); // 1
		System.out.println(a % b); // 1
	}

}
